import Layout from '../components/layout/layout'
import './index.scss'
const Index = () => {
    return (
        <Layout bgColor="#9ad3bc">
            <div className="login-form container">
                <h3 className="text-center p-3">Đăng nhập</h3>

            </div>
        </Layout>
    )
}
export default Index;
